INSERT INTO `comment` VALUES (1,3,'C++是C语言的继承，它既可以进行C语言的过程化程序设计，又可以进行以抽象数据类型为特点的基于对象的程序设计，还可以进行以继承和多态为特点的面向对象的程序设计','2017-11-14 22:47:42',1,5),(2,2,'Java是一门面向对象编程语言，不仅吸收了C++语言的各种优点，还摒弃了C++里难以理解的多继承、指针等概念','2017-11-14 22:47:42',1,17),(3,1,'Python是纯粹的自由软件， 源代码和解释器CPython遵循 GPL(GNU General Public License)协议','2017-11-14 22:47:42',2,11),(4,3,'C++不仅拥有计算机高效运行的实用性特征，同时还致力于提高大规模程序的编程质量与程序设计语言的问题描述能力','2017-11-14 22:47:42',3,18),(5,3,'这是一些关于Java工程师的评论，这个职位需要丰富的阅历的和工作经验','2017-11-14 22:47:42',5,2),(6,2,'又要写测试评论，写点啥呢？布吉岛','2017-11-14 22:47:42',6,8),(7,3,'数据挖掘一般是指从大量的数据中通过算法搜索隐藏于其中信息的过程','2017-11-14 22:47:42',6,14),(8,3,'Java具有简单性、面向对象、分布式、健壮性、安全性、平台独立与可移植性、多线程、动态性等特点','2017-11-14 22:47:42',6,17),(9,2,'Python 已经成为最受欢迎的程序设计语言之一','2017-11-14 22:47:42',1,10),(10,3,'<p>.NET是 Microsoft XML Web services 平台</p>','2017-11-14 22:47:42',2,9),(19,3,'IndexRecruit大透明弱弱地评论一句~','2017-11-16 22:37:26',7,13),(21,3,'学习数据挖掘小白应该从哪个方面入手？萌新小白求教~','2017-11-17 11:32:32',24,14),(23,3,'<p><span><u><b>XML Web services 允许应用程序通过 Internet 进行通讯和共享数据，而不管所采用的是哪种操作系统、设备或编程语言</b></u></span></p>','2017-11-17 21:45:42',25,9),(24,3,'<i>阿里今年双十一赚大发了。。。</i>','2017-11-17 21:56:58',25,1),(25,1,'好','2020-02-26 13:48:55',1,4),(26,1,'1','2020-02-26 13:50:23',1,14),(27,3,'好','2020-02-26 13:52:15',1,776),(28,2,'好','2020-02-26 14:00:03',1,7),(29,1,'<b><i>好</i></b>','2020-02-26 14:19:10',1,840),(30,1,'1','2020-02-26 14:26:59',1,14),(31,3,'1','2020-02-26 14:27:49',1,1005),(32,1,'1','2020-02-26 14:50:28',1,14),(33,1,'1','2020-02-26 15:07:06',1,837),(34,1,'1','2020-02-26 15:38:49',1,21),(35,3,'好','2020-02-28 19:47:31',1,14),(36,3,'好','2020-02-28 19:52:31',1,10),(37,3,'123','2021-03-13 03:41:50',37,717),(38,3,'<b>鹅鹅鹅</b>','2021-03-15 11:23:14',37,741);
